            <h3>{challenge.title}</h3>
            <p>{challenge.description}</p>
            <p>{challenge.challenge_type} Challenge</p>
            <p>
              From {challenge.start_date} to {challenge.end_date}
            </p>
          </div>
        ))}
      </div>
      <Footer />
    </>
  );
}

export default Challenges;
